import React from 'react';

import '../card/card.style.css';

export const Card = props => (
    <div className='card-container'>
        <img alt="monster" src = {`https://robohash.org/${props.monster.id}?set=set2&180x180`}/>
        <h2> {props.monster.name} </h2>
    </div>
);
